import React from 'react';
import Services from './components/Services';

function App() {
  return (
    <div>
      <h1>Pro Ride Coaching</h1>

      {Services.map((service) => (
        <Note img={service.img} title={service.title} description={service.description} btnText={service.title} />
      ))}
    </div>
  );
}

export default App;
